import React from "react";
export default class Model extends React.Component{
    constructor(props) {
        super(props);
        console.log(props);
        this.handleSubmit = this.handleSubmit.bind(this);
    }
    handleSubmit(){
        fetch('http://localhost:8000/api/home?_id=' + this.props.model._id,{
            method: 'DELETE',
        }).then( async (response) => {
            let res = response;
            console.log(res);
        });
    }
    render() {
        return (
            <div class="card">
                <div className="card bg-primary">
                    <div className="card-body">
                        <form onSubmit={this.handleSubmit}>
                            <p className="card-text">
                                <input className="form-control" type="text" placeholder="State" required onChange={(e)=>setState(e.target.value)}/>
                                <input className="form-control" type="date" placeholder="Date" required onChange={(e)=>setDate(e.target.value)}/>
                                <input className="form-control" type="number" min = "0" placeholder="Cases" required onChange={(e)=>setCases(e.target.value)}/>
                                <input className="form-control" type="number" min = "0" placeholder="Deaths" required onChange={(e)=>setDeaths(e.target.value)}/>
                            </p>
                            <button className="btn btn-info" >Add</button>
                        </form>
                    </div> 
                </div>
            </div>
        )
    }
}
